import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faAnglesRight } from '@fortawesome/free-solid-svg-icons';

export default function Card(props){
    let displayData=props.content;
    console.log("content-1->",props)
    return(
        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-4 animate-slideDown">
            {
                displayData.map((el)=>(
                    <div className="bg-white p-3 rounded-md text-center shadow-2xl shadow-indigo-200 hover:shadow-indigo-300 transition ease-in-out hover:-translate-y-1 cursor-pointer " key={el.id}>
                        <h1 className="font-bold text-3xl mb-1 text-indigo-950">{el?.heading}</h1>
                        <p className="text-gray-600 font-bold text-lg mb-6">({el.subHeading})</p>
                        <p className="text-base text-slate-500">{el.content}</p>
                        <p className="text-indigo-950 text-end font-bold mt-5 hover:translate-1"><u>Decription</u><FontAwesomeIcon icon={faAnglesRight} /></p>
                    </div>
                ))
            }
        </div>
    )
}
